```solidity
pragma solidity ^0.4.24;

contract YourContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public remaining;
    uint256 public ethrate;
    address public owner;
    uint256 public collectedamount;
    address public benaddress;
    uint8 public icotokenprice;
    uint8 public icostatus;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => bool) public frozenaccount;

    constructor() public {
        totalsupply = 0x204fce5e3e25026110000000;
        owner = msg.sender;
        balanceof[owner] = totalsupply;
        name = '0';
        symbol = '0';
        decimals = 18;
        remaining = totalsupply;
        ethrate = 300;
        icostatus = 1;
        icotokenprice = 10;
        benaddress = 0x57D1aED65eE1921CC7D2F3702C8A28E5Dd317913;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function changeIcoStatus(uint8 _icostatus) public {
        require(msg.sender == owner);
        icostatus = _icostatus;
    }

    function setTokenPrice(uint8 _icotokenprice) public {
        require(msg.sender == owner);
        icotokenprice = _icotokenprice;
    }

    function withdraw(uint256 _value) public {
        require(msg.sender == owner && _value > 0);
        benaddress.transfer(_value * 1 ether);
    }

    function() public payable {
        // This function is left empty intentionally
    }

    function burn(uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        totalsupply -= _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        _transfer(_from, _to, _value);
    }

    function setEthRate(uint256 _ethrate) public {
        require(msg.sender == owner);
        ethrate = _ethrate;
    }

    function burnFrom(address _from, uint256 _value) public {
        require(balanceof[_from] >= _value);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        totalsupply -= _value;
    }

    function mintToken(uint256 _value) public {
        require(msg.sender == owner);
        balanceof[owner] += _value * 1 ether;
        totalsupply += _value * 1 ether;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        require(balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }

    function withdraw_all() public {
        require(msg.sender == owner);
        benaddress.transfer(address(this).balance);
    }

    function freezeAccount(address _target, bool _freeze) public {
        require(msg.sender == owner);
        frozenaccount[_target] = _freeze;
    }

    function approveAndCall(address _spender, uint256 _value, bytes _extraData) public {
        allowance[msg.sender][_spender] = _value;
        _spender.call(bytes4(bytes32(keccak256("receiveApproval(address,uint256,address,bytes)"))), msg.sender, _value, this, _extraData);
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        balanceof[owner] = 0;
        balanceof[_newOwner] = remaining;
        owner = _newOwner;
    }

    function sellOffline(address _beneficiary, uint256 _value) public {
        require(msg.sender == owner);
        require(_value * 1 ether <= remaining);
        require(remaining > 0);
        remaining -= _value * 1 ether;
        _transfer(owner, _beneficiary, _value * 1 ether);
    }

    function _transfer(address _from, address _to, uint256 _value) internal {
        require(balanceof[_from] >= _value);
        require(balanceof[_to] + _value > balanceof[_to]);
        require(!frozenaccount[_from]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
    }
}
